// cSpell:ignore pfairy

/** Displays assistant images.
 * @param {number} size
 * @returns {HTMLElement|DocumentFragment}
 */
App.Art.assistantArt = function(size) {
	if (V.seeAvatar !== 1) { return new DocumentFragment(); }

	let fileName = "";
	if (V.assistant.customImage && V.assistant.customImage.filename !== "") {
		return App.Art.customArtElement(V.assistant.customImage, size);
	} else if (V.imageChoice === 1) {
		switch (V.assistant.appearance) {
			case "monstergirl":
				fileName = "data:image/png;base64,";
				break;
			case "shemale":
				fileName = "data:image/png;base64,";
				break;
			case "amazon":
				fileName = "data:image/png;base64,";
				break;
			case "businesswoman":
				fileName = "data:image/png;base64,";
				break;
			case "goddess":
				fileName = "data:image/png;base64,";
				break;
			case "hypergoddess":
				fileName = "data:image/png;base64,";
				break;
			case "schoolgirl":
				fileName = "data:image/png;base64,";
				break;
			case "angel":
				fileName = "data:image/png;base64,";
				break;
			case "cherub":
				fileName = "data:image/png;base64,";
				break;
			case "ERROR_1606_APPEARANCE_FILE_CORRUPT":
				fileName = "data:image/png;base64,";
				break;
			case "fairy":
				fileName = "data:image/png;base64,";
				break;
			case "imp":
				fileName = "data:image/png;base64,";
				break;
			case "incubus":
				fileName = "data:image/png;base64,";
				break;
			case "pregnant fairy":
				fileName = "data:image/png;base64,";
				break;
			case "succubus":
				fileName = "data:image/png;base64,";
				break;
			case "witch":
				fileName = "data:image/png;base64,";
				break;
			default:
				fileName = "data:image/png;base64,";
		}
	} else if (V.imageChoice === 5) {
		fileName += "resources/renders/assistant ";
		switch (V.assistant.appearance) {
			case "monstergirl":
				fileName += "monstergirl.png";
				break;
			case "shemale":
				fileName += "shemale.png";
				break;
			case "amazon":
				fileName += "amazon.png";
				break;
			case "businesswoman":
				fileName += "businesswoman.png";
				break;
			case "goddess":
				fileName += "goddess.png";
				break;
			case "schoolgirl":
				fileName += "schoolgirl.png";
				break;
			case "angel":
				fileName += "angel.png";
				break;
			case "cherub":
				fileName += "cherub.png";
				break;
			case "ERROR_1606_APPEARANCE_FILE_CORRUPT":
				fileName += "corrupt.png";
				break;
			case "fairy":
				fileName += "fairy.png";
				break;
			case "imp":
				fileName += "imp.png";
				break;
			case "incubus":
				fileName += "incubus.png";
				break;
			case "pregnant fairy":
				fileName += "pfairy.png";
				break;
			case "succubus":
				fileName += "succubus.png";
				break;
			case "witch":
				fileName += "witch.png";
				break;
			default:
				fileName += "default.png";
		}
	}

	if (fileName) {
		const img = new Image();
		img.src = fileName;
		img.classList.add("assistant");
		const sz = App.Art.artSizeToPx(size);
		if (sz) {
			img.setAttribute("width", sz);
			img.setAttribute("height", sz);
		}
		return img;
	} else {
		return new DocumentFragment();
	}
};
